import React from "react";
import DateDetail from "../../data/detail.json";
const DelailList = () => {
  return (
    <div>
      {DateDetail.map((callback) => (
        <div>
          <h1>{callback.name}</h1>
          <button>Reserve or Book Now</button>
          <p>{callback.address}</p>
        </div>
      ))}
    </div>
  );
};
export default DelailList;
